import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import classes from './Navbar.modules.css';
import Navigationitems from '../NavigationItems/NavigationItems';

const navBar = () => {
    return (
        <div className={classes.navBar}>
            <ul class={classes.nav}>
                <li><a href="#article1">Order</a></li>
                <li><a href="#article2">Blog</a></li>
                <li><a href="#article3">Contact</a></li>
            </ul>   

            <ul class={`${classes.nav} justify-conent-end`}>

                <li><a href="#article1">Location</a></li>
                <li><a href="#article2"><i class="fas fa-map-marker-alt"></i>Login</a>
                </li>
                <li><a href="#article2"><i class="fa fa-search"></i></a></li>
                <li><a href="#article3">Cart</a></li>
            </ul> 
            <Navigationitems />
	    </div>
    );
};

export default navBar;
